Local Rowset &Rs_X_TRN_LTR_DTL_V;
Local integer &Int_Count;

For &i = 1 To &RS_X_TRN_LTR_EE_VW.ActiveRowCount
   &Rs_X_TRN_LTR_DTL_V = &RS_X_TRN_LTR_EE_VW(&i).GetRowset(Scroll.X_TRN_LTR_DTL_V);

   &Int_Count = &Rs_X_TRN_LTR_DTL_V.Select(Record.X_TRN_LTR_DTL_V, "where emplid = :1", &RS_X_TRN_LTR_EE_VW(&i).X_TRN_LTR_EE_VW.EMPLID.Value);;

   If All(&Int_Count) Then
      &RS_X_TRN_LTR_EE_VW(&i).X_TRN_LTR_WRK.GROUPBOX2.Visible = True;
   Else
      &RS_X_TRN_LTR_EE_VW(&i).X_TRN_LTR_WRK.GROUPBOX2.Visible = False;
   End-If;

End-For;

