import PSXP_XMLGEN:*;
import PSXP_RPTDEFNMANAGER:*;


Local PSXP_XMLGEN:RowSetDS &oXML_GENERATOR;
Local File &XML_File;
Local Rowset &RS_X_TRN_LTR_EE_VW;
Local string &XML_Filename_path, &my_xml;
Local integer &i;


&RS_X_TRN_LTR_EE_VW = GetLevel0()(1).GetRowset(Scroll.X_TRN_LTR_EE_VW);

/* set child flag if classes exists */
For &i = 1 To &RS_X_TRN_LTR_EE_VW.ActiveRowCount
   If &RS_X_TRN_LTR_EE_VW(&i).GetRowset(Scroll.X_TRN_LTR_DTL_V)(1).X_TRN_LTR_DTL_V.COURSE.Value > " " Then
      &RS_X_TRN_LTR_EE_VW(&i).X_TRN_LTR_EE_VW.FIRST_CHILD_FLAG.Value = "Y";
   End-If;
End-For;


/* output files */

rem create sample xml file;
&oXML_GENERATOR = create PSXP_XMLGEN:RowSetDS();
&my_xml = &oXML_GENERATOR.getXMLData(&RS_X_TRN_LTR_EE_VW, "");
&XML_File = GetFile("RS_X_TRN_LTR_EE_VW.xml", "W", "UTF8");
&XML_File.WriteLine(&my_xml);

/* save file name and path for publishing */
&XML_Filename_path = &XML_File.Name;
&XML_File.Close();


/* Gen XML Pub report with data file  */
&oXML_PUB = create PSXP_RPTDEFNMANAGER:ReportDefn("X_TRN_SUBTMP");
&oXML_PUB.Get();

/* tell the report where to find the xml file data source */
&oXML_PUB.SetRuntimeDataXMLfile(&XML_Filename_path);

/* Process Report */
&oXML_PUB.ProcessReport("", "", %Date, "");

/* save to clear think time functions */
CommitWork();

/* publish report to new window */
/* for purposes of the demonstration, we just want to show */
/* the xml files created here - not the report itself */
rem &oXML_PUB.DisplayOutput();

/* find location of resulting XML Report */
&sDirSep = "/";
&ReportFileName = &oXML_PUB.ID | "." | Lower(&oXML_PUB.GetOutDestFormatString(2));
&ReportFilePath = &oXML_PUB.OutDestination | &sDirSep | "RptInst" | &sDirSep | &ReportFileName;


CommitWork();


/* use the attachment functions to pop the new merged document to a new window */
/* Report pop */
&Returncode = PutAttachment("record://X_FILEATTACH", &ReportFileName, &ReportFilePath);
&retcode = ViewAttachment("record://X_FILEATTACH", &ReportFileName, &ReportFileName);


